import mobile from './images/illustration-woman-online-mobile.svg'
import desktop from './images/illustration-woman-online-desktop.svg'

function App() {
  return (
    <div className="container">
      <article>
        <picture>
          <source media='(min-width: 768px)' srcSet={desktop} />
          <img src='{mobile}' alt='' />
        </picture>
      </article>
    </div>
  );
}

export default App;
